import { useState } from "react";
import "./App.css";

function App() {
  const [users, setUsers] = useState([
    { name: "Aram", age: 36, id: 1 },
    { name: "Emad", age: 40, id: 1 },
    { name: "Elina", age: 3, id: 1 },
  ]);

  return (
    <div className="App">
      {users.map((user, index) => {
        return (
          <div>
            <h1>
              {user.name}, {user.age}{" "}
              <span>
                <button>delete</button>
              </span>
            </h1>
          </div>
        );
      })}
    </div>
  );
}

export default App;
